import App from "../../../App"


const ProductCard = (props) => {
   const {id, name, value, imageUrl} = props

return (
    <div className="ProductCard">
       <p>ProductCard</p>
       <App id={id} name={name} value={value} imageUrl={imageUrl}/>

    </div>
)
}

export default ProductCard
